import React,{useState} from 'react';
import {Dialog,DialogActions,DialogContent,DialogContentText,DialogTitle,
    Select,MenuItem,Grid,Button,List,TextField,Input,InputAdornment,IconButton} from '@material-ui/core';
import {Person} from '@material-ui/icons';

function UsersGroupsApprolesSearch(props){
    const {open} = props;

    const [selectedValueToSearch,setSelectedValueToSearch] = useState(false);
    const [valueToSearch,setValueToSearch] = useState("");
    const [firstName,setFirstName] = useState("");
    const [lastName,setLastName] = useState("");
    const [email,setEmail] = useState("");
    const [ID,setID] = useState("");
    const [isShowList,setisShowList] = useState();

    return (
        <div>
        <Dialog open={open} fullWidth={true} maxWidth={'xl'}>
            <DialogTitle>جستجوی کاربران گروهها و نقش ها</DialogTitle>
            <DialogContent>
                <DialogContentText>کاربر می تواند جستجو کند</DialogContentText>
                <Grid container xs={12}>
                    <Grid item xs={4}>
                        <Select 
                        value={selectedValueToSearch} 
                        autoWidth={true}
                        onChange={e=>{setSelectedValueToSearch(e.target.value)}}>
                        <MenuItem value={"all"}>All</MenuItem>
                        <MenuItem value={"users"}>Users</MenuItem>
                        <MenuItem value={"groups"}>Groups</MenuItem>
                        <MenuItem value={"applicationRole"}>Application Role</MenuItem>
                        </Select>
                    </Grid>

                    <Grid item xs={6}>
                    <Input
                    value={valueToSearch}
                    fullWidth={true}
                    label={"serach use , groups , ..."}
                    onChange={e=>{setValueToSearch(e.target.value);}}
                    endAdornment={
                        <InputAdornment position="end">
                            <IconButton onClick={e=>{console.log("hello worlds !!!!")}}><Person/></IconButton>
                        </InputAdornment>
                    }
                    />
                    </Grid>
                    {/* <Select >
                        <List><TextField label="نام" value={firstName}/></List>
                        <List><TextField label="نام خانوادگی" value={lastName}/></List>
                        <List><TextField label="ایمیل" value={email}/></List>
                        <List><TextField label="شناسه جستجو" value={ID}/></List>
                    </Select> */}
                    <Grid item xs={1}>
                        <Button onClick={e=>{}}>جستجو</Button>
                    </Grid>
                    <Grid item xs={1}>
                        <Button onClick={e=>{}}>ریست</Button>
                    </Grid>                    
                </Grid>
            </DialogContent>
        </Dialog>
        <Dialog open={isShowList}>

        </Dialog>                        
        </div>
    );
}

export default UsersGroupsApprolesSearch;
